import{_ as t,a as o,o as a,ag as r}from"./chunks/framework.5tktTsRe.js";const p=JSON.parse('{"title":"Frequently Asked Questions","description":"Common questions and troubleshooting for software and plugins.","frontmatter":{"title":"Frequently Asked Questions","description":"Common questions and troubleshooting for software and plugins."},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),i={name:"faq.md"};function n(s,e,l,c,d,h){return a(),o("div",null,e[0]||(e[0]=[r(`<h1 id="frequently-asked-questions" tabindex="-1">Frequently Asked Questions <a class="header-anchor" href="#frequently-asked-questions" aria-label="Permalink to &quot;Frequently Asked Questions&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Use <strong>Ctrl+F</strong> / <strong>⌘+F</strong> to easily navigate the page.</p></div><h2 id="general-questions" tabindex="-1">⭐ General Questions <a class="header-anchor" href="#general-questions" aria-label="Permalink to &quot;:star: General Questions&quot;">​</a></h2><h3 id="_1-is-x-plugin-compatible-with-my-after-effects-version" tabindex="-1">1. Is [X] plugin compatible with my After Effects version? <a class="header-anchor" href="#_1-is-x-plugin-compatible-with-my-after-effects-version" aria-label="Permalink to &quot;1. Is [X] plugin compatible with my After Effects version?&quot;">​</a></h3><p>The majority of plugins available on our Rentry will work on any &quot;common&quot; version of After Effects (2018+). Most scripts will only work on 2020/21+.</p><h3 id="_2-how-can-i-resolve-this-unlicensed-adobe-app-will-be-disabled-soon" tabindex="-1">2. How can I resolve &quot;This unlicensed Adobe app will be disabled soon&quot;? <a class="header-anchor" href="#_2-how-can-i-resolve-this-unlicensed-adobe-app-will-be-disabled-soon" aria-label="Permalink to &quot;2. How can I resolve &quot;This unlicensed Adobe app will be disabled soon&quot;?&quot;">​</a></h3><p>This alert is fairly common and nothing you need to freak out over. <a href="https://rentry.co/adobe-gcc" target="_blank" rel="noreferrer"><strong>Click here</strong></a> to learn how to remove it.</p><h3 id="_3-what-will-happen-if-i-switch-after-effects-versions-plugins-presets-etc" tabindex="-1">3. What will happen if I switch After Effects versions? (plugins, presets, etc..) <a class="header-anchor" href="#_3-what-will-happen-if-i-switch-after-effects-versions-plugins-presets-etc" aria-label="Permalink to &quot;3. What will happen if I switch After Effects versions? (plugins, presets, etc..)&quot;">​</a></h3><p><a href="https://rentry.co/saturn-aeswap" target="_blank" rel="noreferrer"><strong>Click here</strong></a> to learn how you can make a smooth transition when upgrading versions without losing anything. It&#39;s easier than you might think.</p><h3 id="_4-what-are-plugins-and-which-ones-should-i-download" tabindex="-1">4. What are plugins and which ones should I download? <a class="header-anchor" href="#_4-what-are-plugins-and-which-ones-should-i-download" aria-label="Permalink to &quot;4. What are plugins and which ones should I download?&quot;">​</a></h3><p><a href="https://discord.com/channels/1204538209057382493/1230370991985786911" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for a recommendation list.</p><h3 id="_5-which-version-of-after-effects-is-the-best" tabindex="-1">5. Which version of After Effects is the &quot;best&quot;? <a class="header-anchor" href="#_5-which-version-of-after-effects-is-the-best" aria-label="Permalink to &quot;5. Which version of After Effects is the &quot;best&quot;?&quot;">​</a></h3><p>The newest version (features) is always worth getting as long as you have enough RAM and a good CPU, unless you&#39;re on Mac or on a lower end PC. <a href="https://discord.com/channels/1204538209057382493/1381227246106447942" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for more information.</p><h3 id="_6-can-i-download-cracked-plugins-even-though-i-have-a-legitimate-copy-of-after-effects" tabindex="-1">6. Can I download cracked plugins even though I have a legitimate copy of After Effects? <a class="header-anchor" href="#_6-can-i-download-cracked-plugins-even-though-i-have-a-legitimate-copy-of-after-effects" aria-label="Permalink to &quot;6. Can I download cracked plugins even though I have a legitimate copy of After Effects?&quot;">​</a></h3><p>Yes.</p><h3 id="_7-there-is-a-watermark-red-x-when-i-use-a-plugin" tabindex="-1">7. There is a watermark / red x when I use a plugin? <a class="header-anchor" href="#_7-there-is-a-watermark-red-x-when-i-use-a-plugin" aria-label="Permalink to &quot;7. There is a watermark / red x when I use a plugin?&quot;">​</a></h3><p>A watermark means that whatever plugin you&#39;re using is unlicensed. This indicates you did not install it properly and that you should try again from scratch. Make sure to properly read the readme.txt if there is one, and to check our install tutorials.</p><h3 id="_8-my-plugin-software-says-it-can-be-updated-should-i-click-accept" tabindex="-1">8. My plugin/software says it can be updated. Should I click accept? <a class="header-anchor" href="#_8-my-plugin-software-says-it-can-be-updated-should-i-click-accept" aria-label="Permalink to &quot;8. My plugin/software says it can be updated. Should I click accept?&quot;">​</a></h3><p>No. You never want to risk updating cracked software through official update alerts, as the crack will likely stop working. If you would like to upgrade any of your software, you&#39;ll need to uninstall and install a newer cracked version.</p><h3 id="_9-i-have-duplicate-effects-from-a-plugin-what-do-i-do" tabindex="-1">9. I have duplicate effects from a plugin. What do I do? <a class="header-anchor" href="#_9-i-have-duplicate-effects-from-a-plugin-what-do-i-do" aria-label="Permalink to &quot;9. I have duplicate effects from a plugin. What do I do?&quot;">​</a></h3><p>Choose and delete one of the paths shown in the popup. For example, during Sapphire duplicates you may have both:</p><ul><li><code>C:\\Program Files\\Adobe\\Common\\Plug-ins\\7.0\\MediaCore\\Sapphire Plug-ins,</code></li><li><code>C:\\Program Files\\Adobe\\Common\\Plug-ins\\7.0\\MediaCore\\BorisFX\\Sapphire Plug-ins</code></li></ul><p>You can either delete the first or the second. <a href="https://streamable.com/9okqr8" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for a video example.</p><h3 id="_10-i-installed-an-extension-e-g-flow-but-nothing-happens-when-i-click-on-it-in-after-effects-what-do-i-do" tabindex="-1">10. I installed an extension (e.g: Flow) but nothing happens when I click on it in After Effects. What do I do? <a class="header-anchor" href="#_10-i-installed-an-extension-e-g-flow-but-nothing-happens-when-i-click-on-it-in-after-effects-what-do-i-do" aria-label="Permalink to &quot;10. I installed an extension (e.g: Flow) but nothing happens when I click on it in After Effects. What do I do?&quot;">​</a></h3><p>Ensure that the CEP (Common Extensibility Platform) is enabled.</p><p><strong>Windows:</strong></p><ul><li>Close After Effects.</li><li>Download <a href="https://www.mediafire.com/file/g6pdj9v5xdyjkax/keys.reg/file" target="_blank" rel="noreferrer"><strong>this file</strong></a> and run it.</li><li>Done!</li></ul><p><strong>MacOS:</strong></p><ul><li>Close After Effects and open Terminal.</li><li>Copy and paste the text below:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>defaults write com.adobe.CSXS.10 PlayerDebugMode 1</span></span>
<span class="line"><span>defaults write com.adobe.CSXS.11 PlayerDebugMode 1</span></span>
<span class="line"><span>defaults write com.adobe.CSXS.12 PlayerDebugMode 1</span></span>
<span class="line"><span>defaults write com.adobe.CSXS.13 PlayerDebugMode 1</span></span></code></pre></div><ul><li>Hit enter and you&#39;re done.</li></ul><h3 id="_11-generative-ai-is-not-working-help" tabindex="-1">11. Generative AI is not working. Help! <a class="header-anchor" href="#_11-generative-ai-is-not-working-help" aria-label="Permalink to &quot;11. Generative AI is not working. Help!&quot;">​</a></h3><p>AI Tools such as Generative Fill will not work on cracked Photoshop. Adobe made these tools credit based which requires a connection to Adobe servers in order to work, which leads to users getting banned soon after. If you want these tools you will have to pay. Any website promoting a cracked version of Generative Fill is likely malware. <br></p><h3 id="_12-missing-cep-folder" tabindex="-1">12. Missing CEP folder. <a class="header-anchor" href="#_12-missing-cep-folder" aria-label="Permalink to &quot;12. Missing CEP folder.&quot;">​</a></h3><p>Make sure your installation isn’t faulty, and that scripting and expressions are enabled in After Effects.</p><ul><li>Open After Effects.</li><li>Locate Scripting &amp; Expressions and enable “Allow Scripts to Write Files and Access Network”. <ul><li>Windows: <code>Edit &gt; Preferences &gt; Scripting &amp; Expressions</code></li><li>MacOS: <code>After Effects &gt; Preferences &gt; Scripting &amp; Expressions</code></li></ul></li></ul><br><p><strong>Create the CEP folder manually:</strong><br> MacOS:</p><ul><li>Go to the location below and create a <strong>CEP</strong> folder.<br><code>/Library/Application Support/Adobe/</code></li><li>Inside that CEP folder, create another folder named <strong>extensions</strong>. <br></li></ul><p>Windows:</p><ul><li>Go to each of these locations (one at a time):</li></ul><blockquote><p><code>C:\\Program Files (x86)\\Common Files\\Adobe</code><br><code>C:\\Program Files\\Common Files\\Adobe</code></p></blockquote><ul><li>In each location, create a <strong>CEP</strong> folder, if there isn&#39;t one.</li><li>Inside each CEP folder, create a subfolder called <strong>extensions</strong>.</li></ul><h2 id="windows-issues" tabindex="-1">⭐ Windows Issues <a class="header-anchor" href="#windows-issues" aria-label="Permalink to &quot;:star: Windows Issues&quot;">​</a></h2><h3 id="_1-windows-cannot-complete-the-extraction-the-destination-file-could-not-be-created" tabindex="-1">1. &quot;Windows cannot complete the extraction. The destination file could not be created&quot; <a class="header-anchor" href="#_1-windows-cannot-complete-the-extraction-the-destination-file-could-not-be-created" aria-label="Permalink to &quot;1. &quot;Windows cannot complete the extraction. The destination file could not be created&quot;&quot;">​</a></h3><p>The majority of our files are password encrypted which File Explorer doesn&#39;t support. In order to open our files without error, you’ll need to install a third party software, such as <a href="https://www.7-zip.org/download.html" target="_blank" rel="noreferrer"><strong>7-ZIP</strong></a> to extract.</p><h3 id="_2-an-unexpected-error-is-keeping-you-from-copying-the-file-error-0x80004005" tabindex="-1">2. &quot;An unexpected error is keeping you from copying the file, Error 0x80004005&quot; <a class="header-anchor" href="#_2-an-unexpected-error-is-keeping-you-from-copying-the-file-error-0x80004005" aria-label="Permalink to &quot;2. &quot;An unexpected error is keeping you from copying the file, Error 0x80004005&quot;&quot;">​</a></h3><p>This error usually occurs if a file hasn&#39;t been properly extracted.</p><ul><li>Right click the file you want to open &gt; 7-Zip &gt; Extract here &gt; Enter Password &gt; OK.</li></ul><p>This will create an uncompressed version of the folder. Open it and proceed as normal.</p><h3 id="_3-the-application-was-unable-to-start-correctly-oxc0000142-click-ok-to-close-the-application" tabindex="-1">3. &quot;The application was unable to start correctly (Oxc0000142). Click OK to close the application.&quot; <a class="header-anchor" href="#_3-the-application-was-unable-to-start-correctly-oxc0000142-click-ok-to-close-the-application" aria-label="Permalink to &quot;3. &quot;The application was unable to start correctly (Oxc0000142). Click OK to close the application.&quot;&quot;">​</a></h3><p>Starting from version 24.1, <strong>After Effects requires your processor to support Advanced Vector Extensions 2</strong> or else the software will not launch.<br></p><p>If your processor does not support AVX2, <strong>you&#39;ll need to downgrade to AE 2023 or lower</strong>.</p><h3 id="_4-the-system-cannot-find-the-path-specified" tabindex="-1">4. &quot;The system cannot find the path specified.&quot; <a class="header-anchor" href="#_4-the-system-cannot-find-the-path-specified" aria-label="Permalink to &quot;4. &quot;The system cannot find the path specified.&quot;&quot;">​</a></h3><p>Move the folder to desktop and try again. If that does not work, remove the &quot;/&quot; symbol from the folder name.</p><h3 id="_5-error-code-24-adobe" tabindex="-1">5. Error Code: 24 (Adobe) <a class="header-anchor" href="#_5-error-code-24-adobe" aria-label="Permalink to &quot;5. Error Code: 24 (Adobe)&quot;">​</a></h3><p>For some unknown reason, Defender marks the Set-up.exe file as suspicious for some users and stops it. Even so, the file is not deleted, and Defender does not send any warnings for it.</p><ul><li>Extract the <strong>iso</strong> file (Right click &gt; 7-Zip &gt; Extract here)</li><li>Temporarily turn off your internet.</li><li>Open the extracted folder and run <strong>Set-up.exe</strong>.</li></ul><h3 id="_6-afterfx-exe-system-error-the-code-execution-cannot-proceed-because-msvcp110-dll-was-not-found" tabindex="-1">6. &quot;AfterFX.exe - System Error. The code execution cannot proceed because MSVCP110.dll was not found.&quot; <a class="header-anchor" href="#_6-afterfx-exe-system-error-the-code-execution-cannot-proceed-because-msvcp110-dll-was-not-found" aria-label="Permalink to &quot;6. &quot;AfterFX.exe - System Error. The code execution cannot proceed because MSVCP110.dll was not found.&quot;&quot;">​</a></h3><p>Your computer is missing necessary components. Install Microsoft Visual C++ Redistributable 2012: <a href="https://learn.microsoft.com/en-us/cpp/windows/latest-supported-vc-redist" target="_blank" rel="noreferrer">https://learn.microsoft.com/en-us/cpp/windows/latest-supported-vc-redist</a> &amp; restart your computer.</p><h3 id="_7-davinci-resolve-studio-not-starting" tabindex="-1">7. DaVinci Resolve Studio not starting. <a class="header-anchor" href="#_7-davinci-resolve-studio-not-starting" aria-label="Permalink to &quot;7. DaVinci Resolve Studio not starting.&quot;">​</a></h3><p>Rename OFX folder &quot;Plugins&quot; (<code>C:\\Program Files\\Common Files\\OFX</code>) to &quot;Plugins.origin&quot;.</p><h3 id="_8-the-installation-cannot-continue-as-the-installer-file-may-be-damaged-download-the-installer-file-again" tabindex="-1">8. &quot;The installation cannot continue as the installer file may be damaged. Download the installer file again.&quot; <a class="header-anchor" href="#_8-the-installation-cannot-continue-as-the-installer-file-may-be-damaged-download-the-installer-file-again" aria-label="Permalink to &quot;8. &quot;The installation cannot continue as the installer file may be damaged. Download the installer file again.&quot;&quot;">​</a></h3><p>Extract the file correctly with 7-Zip or WinRAR:</p><ol><li>Install and use <a href="https://www.7-zip.org" target="_blank" rel="noreferrer"><strong>7-ZIP</strong></a> / Alternative: <a href="https://www.win-rar.com/start.html?&amp;L=0" target="_blank" rel="noreferrer">WinRAR</a></li><li>Right-click the .zip file &gt; 7-ZIP (under “show more options” if on Windows 11) &gt; Extract here &gt; Enter password &gt; OK.</li></ol><p>This will create an uncompressed version of the folder (without a zipper). Open that version and proceed as normal.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If it is extracted, it means you have leftovers of a previous installation. Use the official <a href="https://swupmf.adobe.com/webfeed/CleanerTool/win/AdobeCreativeCloudCleanerTool.exe" target="_blank" rel="noreferrer">Adobe Creative Cloud Cleaner Tool</a> to get rid of previous installations.</p></div><h3 id="_9-error-code-127-adobe" tabindex="-1">9. Error Code 127 (Adobe) <a class="header-anchor" href="#_9-error-code-127-adobe" aria-label="Permalink to &quot;9. Error Code 127 (Adobe)&quot;">​</a></h3><p><a href="https://helpx.adobe.com/creative-cloud/kb/troubleshoot-download-install-logs.html#error127" target="_blank" rel="noreferrer">Error code 127</a> indicates that the installer isn&#39;t able to extract the zip file in the <code>adobeTemp</code> folder. This might happen due to a lack of disk space or if the necessary permissions are unavailable. Sometimes, even antivirus software can block the extraction process in the temp directory.</p><ol><li>Navigate to the <code>adobetemp</code> folder located at <code>&lt;Root Drive&gt;\\adobeTemp</code>. In the following example, the root drive is the C: drive.</li></ol><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If the folder doesn&#39;t exist, you can also create the folder.</p></div><ol start="2"><li>Right click anywhere on screen &gt; <strong>Properties</strong>.</li><li>In the <strong>Security</strong> tab, ensure that permissions for <strong>System</strong> and <strong>Administrators</strong> have <strong>Full Control</strong>.</li><li>Turn off your antivirus temporarily or whitelist it.</li></ol><h2 id="macos-issues" tabindex="-1">⭐ MacOS Issues <a class="header-anchor" href="#macos-issues" aria-label="Permalink to &quot;:star: MacOS Issues&quot;">​</a></h2><h3 id="_1-after-effects-can-t-continue-unexpected-failure-during-application-startup" tabindex="-1">1. &quot;After Effects can&#39;t continue: unexpected failure during application startup.&quot; <a class="header-anchor" href="#_1-after-effects-can-t-continue-unexpected-failure-during-application-startup" aria-label="Permalink to &quot;1. &quot;After Effects can&#39;t continue: unexpected failure during application startup.&quot;&quot;">​</a></h3><p>After Effects 2021 and below are not compatible with Sonoma. You won’t be able to launch these versions of After Effects. Your only option is to install After Effects 2022 or higher.</p><div class="info custom-block"><p class="custom-block-title">If this appears on version 2022+:</p><blockquote><p><a href="https://community.adobe.com/t5/after-effects-bugs/after-effects-23-6-and-24-0-not-starting-on-macos-14-sonoma/idi-p/14139194#comments" target="_blank" rel="noreferrer">https://community.adobe.com/t5/after-effects-bugs/after-effects-23-6-and-24-0-not-starting-on-macos-14-sonoma/idi-p/14139194#comments</a></p></blockquote></div><h3 id="_2-the-following-plugins-are-installed-but-are-not-yet-compatible-with-this-version" tabindex="-1">2. &quot;The following plugins are installed but are not yet compatible with this version&quot;. <a class="header-anchor" href="#_2-the-following-plugins-are-installed-but-are-not-yet-compatible-with-this-version" aria-label="Permalink to &quot;2. &quot;The following plugins are installed but are not yet compatible with this version&quot;.&quot;">​</a></h3><p>This issue occurs when a user installs a plugin only supporting Intel Macs (older version or crack) on After Effects that is running native to Apple Silicon (M1+ chip on 2022 and higher).</p><p><a href="https://rentry.co/rosetta-adobe" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for an in-depth explanation, as well as possible fixes and workarounds.</p><h3 id="_3-x-is-damaged-and-cannot-be-opened-you-should-eject-the-disk-image-you-should-move-it-to-the-trash" tabindex="-1">3. &quot;[X] is damaged and cannot be opened, you should eject the disk image / you should move it to the trash.&quot; <a class="header-anchor" href="#_3-x-is-damaged-and-cannot-be-opened-you-should-eject-the-disk-image-you-should-move-it-to-the-trash" aria-label="Permalink to &quot;3. &quot;[X] is damaged and cannot be opened, you should eject the disk image / you should move it to the trash.&quot;&quot;">​</a></h3><h4 id="if-the-error-occurs-when-installing-software-plugins" tabindex="-1"><strong>If the error occurs when installing software/plugins:</strong> <a class="header-anchor" href="#if-the-error-occurs-when-installing-software-plugins" aria-label="Permalink to &quot;**If the error occurs when installing software/plugins:**&quot;">​</a></h4><ul><li>Drag the installer to your desktop, open Terminal and execute:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo xattr -cr</span></span></code></pre></div><ul><li><p>Drag the installer next to it.</p><p><strong>There must be a space between the command and the file</strong>.<br></p></li><li><p>Hit enter and submit your Mac password. Passwords are not displayed when typed into Terminal.</p></li></ul><p><a href="https://youtu.be/-7YCWM2Xvc0?si=8nCYp7vv4L6sZDIk" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for a visual guide.</p><div class="tip custom-block"><p class="custom-block-title">IMPORTANT NOTE</p><p>If your damaged file is inside of a .dmg, you will have to move it outside of it for it to work!</p></div><h4 id="if-a-plugin-shows-this-error-inside-after-effects" tabindex="-1"><strong>If a plugin shows this error inside After Effects:</strong><br> <a class="header-anchor" href="#if-a-plugin-shows-this-error-inside-after-effects" aria-label="Permalink to &quot;**If a plugin shows this error inside After Effects:**&lt;br&gt;&quot;">​</a></h4><ul><li>Open Terminal and execute <code>sudo xattr -rd com.apple.quarantine</code> and drag the .plugin file next to the command, <strong>there must be a space between the command and the file</strong>.<br> Press enter and submit your password.<br></li></ul><p><a href="https://monter.is/posts/mac-guide" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for a visual guide.</p><h3 id="_4-the-installation-cannot-continue-as-the-installer-file-may-be-damaged-download-the-installer-file-again" tabindex="-1">4. &quot;The installation cannot continue as the installer file may be damaged. Download the installer file again.&quot; <a class="header-anchor" href="#_4-the-installation-cannot-continue-as-the-installer-file-may-be-damaged-download-the-installer-file-again" aria-label="Permalink to &quot;4. &quot;The installation cannot continue as the installer file may be damaged. Download the installer file again.&quot;&quot;">​</a></h3><ul><li>Right Click &gt; Show Package Contents &gt; Contents &gt; MacOS &gt; Install.</li></ul><p><a href="https://youtu.be/xYzHPySXdo4?si=FdmZjhIo_r5rt2Mj" target="_blank" rel="noreferrer"><strong>Click here</strong></a> for an example video.</p><h3 id="_5-you-don-t-have-xcode-command-line-tools" tabindex="-1">5. &quot;You don&#39;t have XCode Command Line tools&quot; <a class="header-anchor" href="#_5-you-don-t-have-xcode-command-line-tools" aria-label="Permalink to &quot;5. &quot;You don&#39;t have XCode Command Line tools&quot;&quot;">​</a></h3><ul><li>Monters &quot;23.6 fix.pkg&quot; is unsupported on Sonoma, causing this error. You won&#39;t be able to run it.</li></ul><p>You can Download &amp; run this alternative <a href="https://www.mediafire.com/file/uzy5d89ufktmw9c/ADOBE+23.6+FIX.zip/file" target="_blank" rel="noreferrer"><strong>patcher</strong></a> instead, 100% working. Instructions are included.</p><h3 id="_6-error-couldn-t-find-main-entry-point" tabindex="-1">6. &quot;Error: couldn&#39;t find main entry point&quot; <a class="header-anchor" href="#_6-error-couldn-t-find-main-entry-point" aria-label="Permalink to &quot;6. &quot;Error: couldn&#39;t find main entry point&quot;&quot;">​</a></h3><p><em>This typically means the app and/or plugin you&#39;re trying to run is missing a key file it needs to start, or it’s not installed correctly.</em></p><div class="info custom-block"><p class="custom-block-title">NOTE</p><p><strong>If seeing this on latest Sequoia with Twixtor 8, use RE:Vision 2024 Bundle from the <a href="https://rentry.co/satvrn-archived" target="_blank" rel="noreferrer">archive</a>!</strong></p></div><ol><li>Make sure it&#39;s installed correctly. Refer to text instructions and/or visual guides.</li><li>Try reinstalling the plugin/software you are experiencing issues with. <br><br></li></ol><h4 id="disable-gatekeeper-not-recommended-last-resort" tabindex="-1"><strong>Disable gatekeeper (not recommended, last resort):</strong> <a class="header-anchor" href="#disable-gatekeeper-not-recommended-last-resort" aria-label="Permalink to &quot;**Disable gatekeeper (not recommended, last resort):**&quot;">​</a></h4><ol><li>Open Terminal.</li><li>Input <code>sudo spctl --master-disable</code> &amp; press enter.</li><li>Enter your Mac password when prompted &amp; press enter.</li><li>Go to System Preferences &gt; Security &amp; Privacy &gt; General</li><li>You should see an &quot;Anywhere&quot; option under &quot;Allow apps downloaded from&quot;, select &quot;Anywhere&quot;.</li></ol><p><em>If the option is greyed out, click the lock in the bottom left and enter your password to unlock settings.</em></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can also disable Gatekeeper by using <strong><a href="https://itsalin.com/appInfo/?id=sentinel%3E" target="_blank" rel="noreferrer">Sentinel</a>.</strong></p></div><h3 id="_7-failed-with-error-code-133-adobe" tabindex="-1">7. Failed with error code 133 (Adobe) <a class="header-anchor" href="#_7-failed-with-error-code-133-adobe" aria-label="Permalink to &quot;7. Failed with error code 133 (Adobe)&quot;">​</a></h3><p>Error 133 indicates insufficient disk space to download and install the applications. Free up some space or select another location for your app and try again.</p><h3 id="_8-x-cannot-be-opened-because-it-is-from-an-unidentified-developer-because-apple-cannot-check-it-for-malicious-software-cannot-verify-that-this-app-is-free-from-malware" tabindex="-1">8. &quot;[X] cannot be opened because it is from an unidentified developer&quot; / &quot;because Apple cannot check it for malicious software&quot; / &quot;cannot verify that this app is free from malware&quot;. <a class="header-anchor" href="#_8-x-cannot-be-opened-because-it-is-from-an-unidentified-developer-because-apple-cannot-check-it-for-malicious-software-cannot-verify-that-this-app-is-free-from-malware" aria-label="Permalink to &quot;8. &quot;[X] cannot be opened because it is from an unidentified developer&quot; / &quot;because Apple cannot check it for malicious software&quot; / &quot;cannot verify that this app is free from malware&quot;.&quot;">​</a></h3><p><em>By default, macOS blocks most apps that aren’t from the App Store, even if they’re completely safe.</em></p><h4 id="if-the-error-occurs-when-attempting-to-run-any-sort-of-dmg-or-pkg-file" tabindex="-1"><strong>If the error occurs when attempting to run any sort of dmg or pkg file:</strong> <a class="header-anchor" href="#if-the-error-occurs-when-attempting-to-run-any-sort-of-dmg-or-pkg-file" aria-label="Permalink to &quot;**If the error occurs when attempting to run any sort of dmg or pkg file:**&quot;">​</a></h4><ol><li>Right-click the file <em>(hold the ctrl key and click the file to bring up the menu)</em></li><li>Select Open</li><li>It will show a warning, but this time it will give you an “Open Anyway” button. Click it to continue.</li></ol><div class="info custom-block"><p class="custom-block-title">READ</p><p>If the step above doesn&#39;t work, do the step below as well.</p></div><h4 id="if-the-error-occurs-for-a-plugin-example-deep-glow" tabindex="-1"><strong>If the error occurs for a plugin (example: Deep Glow):</strong> <a class="header-anchor" href="#if-the-error-occurs-for-a-plugin-example-deep-glow" aria-label="Permalink to &quot;**If the error occurs for a plugin (example: Deep Glow):**&quot;">​</a></h4><ol><li>Click the Apple logo in the top left corner.</li><li>Go to System Preferences (or System Settings).</li><li>Open Security &amp; Privacy.</li><li>At the bottom of the window, look for a message saying the app/plugin was blocked.</li><li>Click <strong>Allow Anyway</strong>. <em>You might need to unlock settings by clicking the lock icon in the bottom left corner, and then entering your password.</em></li></ol><h3 id="_9-unable-to-expand-x-into-error-79" tabindex="-1">9. &quot;Unable to expand [X] into &quot; &quot;. (Error 79)&quot; <a class="header-anchor" href="#_9-unable-to-expand-x-into-error-79" aria-label="Permalink to &quot;9. &quot;Unable to expand [X] into &quot; &quot;. (Error 79)&quot;&quot;">​</a></h3><ul><li>Install <a href="https://d.keka.io/" target="_blank" rel="noreferrer"><strong>Keka</strong></a>.</li><li>Right click the file you want to open &gt; Open with &gt; Keka &gt; Extract &gt; Enter our password &gt; OK. This will create an uncompressed version of the folder. Open it and proceed as normal.</li></ul><h3 id="_10-can-t-find-error-loading-sapphire-bundle" tabindex="-1">10. &quot;Can&#39;t find/Error loading Sapphire bundle&quot; <a class="header-anchor" href="#_10-can-t-find-error-loading-sapphire-bundle" aria-label="Permalink to &quot;10. &quot;Can&#39;t find/Error loading Sapphire bundle&quot;&quot;">​</a></h3><p>Make sure to fully uninstall Sapphire.</p><ol><li>Run the uninstaller located in <code>Applications/GenArtsSapphire/Uninstall Sapphire</code></li><li>Next, disable gatekeeper by executing the following command in Terminal:</li></ol><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo spctl --master-disable</span></span></code></pre></div><blockquote><p>Alternatively you can use <a href="https://itsalin.com/appInfo/?id=sentinel" target="_blank" rel="noreferrer">Sentinel</a> which is easier for new Mac users.</p></blockquote><ol start="3"><li>Click the Apple menu &gt; System Preferences &gt; Security &amp; Privacy &gt; General. Scroll to the bottom and select &quot;anywhere&quot; under &quot;Allow apps downloaded from&quot;.</li></ol><p>Restart your Mac and reinstall the plugin.</p><h3 id="_11-there-was-a-problem-installing-ccxprocess" tabindex="-1">11. &quot;There was a problem installing CCXProcess&quot; <a class="header-anchor" href="#_11-there-was-a-problem-installing-ccxprocess" aria-label="Permalink to &quot;11. &quot;There was a problem installing CCXProcess&quot;&quot;">​</a></h3><ul><li>Press Command+Spacebar and type Terminal, open terminal.</li><li>Copy &amp; paste the following:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo softwareupdate --install-rosetta --agree-to-license</span></span></code></pre></div><ul><li>Press enter. After Rosetta is installed, run the Adobe installer again.</li></ul><h3 id="_12-the-file-patch-command-could-not-be-executed-because-you-do-not-have-appropriate-access-privileges" tabindex="-1">12. &quot;The file “Patch.command” could not be executed because you do not have appropriate access privileges.&quot; <a class="header-anchor" href="#_12-the-file-patch-command-could-not-be-executed-because-you-do-not-have-appropriate-access-privileges" aria-label="Permalink to &quot;12. &quot;The file “Patch.command” could not be executed because you do not have appropriate access privileges.&quot;&quot;">​</a></h3><ul><li>Open Terminal.</li><li>Copy &amp; paste the following:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>chmod +x</span></span></code></pre></div><ul><li>Insert a space.</li><li>Drop the file into Terminal.</li><li>Click on the Terminal window, and then press return.</li></ul><h3 id="_13-error-creating-directory-unknown-variable-asesupportfilepath-1" tabindex="-1">13. Error creating directory / ***unknown variable asesupportfilepath 1*** <a class="header-anchor" href="#_13-error-creating-directory-unknown-variable-asesupportfilepath-1" aria-label="Permalink to &quot;13. Error creating directory / \\*\\*\\*unknown variable asesupportfilepath 1*\\*\\*&quot;">​</a></h3><p><em>This error can appear when attempting to install Maxon plugins.</em></p><ul><li>Click Abort</li><li>Open Terminal</li><li>Copy &amp; paste this in:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo sh /Volumes/Red\\ Giant\\ Installer/Red\\ Giant\\ Installer.app/Contents/MacOS/installbuilder.sh --mode text</span></span></code></pre></div><ul><li>Enter you password when prompted, and then hit Y if prompted.</li></ul><h3 id="_14-error-code-127-adobe" tabindex="-1">14. Error Code 127 (Adobe) <a class="header-anchor" href="#_14-error-code-127-adobe" aria-label="Permalink to &quot;14. Error Code 127 (Adobe)&quot;">​</a></h3><p><a href="https://helpx.adobe.com/creative-cloud/kb/troubleshoot-download-install-logs.html#error127" target="_blank" rel="noreferrer">Error code 127</a> indicates that the installer isn&#39;t able to extract the zip file in the <code>adobeTemp</code> folder. This might happen due to a lack of disk space or if the necessary permissions are unavailable. Sometimes, even antivirus software can block the extraction process in the temp directory.</p><blockquote><p>Note: Open the folder where you want to see the hidden files, and select &quot;Command&quot;+&quot;Shift&quot;+&quot;.&quot; keys simultaneously.</p></blockquote><ol><li><p>Navigate to the <code>adobetemp</code> folder located at:</p><p><code>/System/Volumes/&lt;Root Drive&gt;/.adobeTemp</code></p></li><li><p>Go to <strong>File &gt; Get Info</strong>, then select <strong>Sharing &amp; Permissions</strong>.</p></li><li><p>Select system from the <strong>Name</strong> column. Ensure that is has <strong>Read &amp; Write</strong> privileges.</p></li><li><p>Turn off your antivirus temporarily or whitelist it. You can also free up some space and retry.</p></li></ol>`,138)]))}const f=t(i,[["render",n]]);export{p as __pageData,f as default};
